import React, { Component } from 'react';

class Course extends Component {
    render() {
    return (
        <div>
            <h1>{this.props.title}</h1>
            <h2>{this.props.id}</h2>
            <p>{this.props.body}</p>
        </div>
    );
    }

}

export default Course;
